import numpy as np
import math

np.set_printoptions(threshold=np.inf)

def sigmoid(x):
    return 1 / (1 + np.exp(-x))

def sigmoid_derivative(x):
    return sigmoid(x) * (1 - sigmoid(x))

def train(X, y, n_hidden, learning_rate, n_iter):
    m, n_input = X.shape

    # Randomly initialize weights and biases
    w1 = np.random.randn(n_input, n_hidden)
    b1 = np.zeros((1, n_hidden))
    w2 = np.random.randn(n_hidden, 1)
    b2 = np.zeros((1, 1))

    # Training loop
    for i in range(n_iter + 1):
        # Forward propagation
        z2 = np.dot(X, w1) + b1
        a2 = sigmoid(z2)
        z3 = np.dot(a2, w2) + b2
        a3 = z3  # Linear output for regression

        # Compute loss
        dz3 = a3 - y
        dw2 = np.dot(a2.T, dz3)
        db2 = np.sum(dz3, axis=0, keepdims=True)
        dz2 = np.dot(dz3, w2.T) * sigmoid_derivative(z2)
        dw1 = np.dot(X.T, dz2)
        db1 = np.sum(dz2, axis=0)

        # Update weights and biases
        w1 -= learning_rate * dw1 / m
        w2 -= learning_rate * dw2 / m
        b1 -= learning_rate * db1 / m
        b2 -= learning_rate * db2 / m

        if i%1000 == 0:
            loss = np.mean(np.square(dz3))
        if i == n_iter:
            for u in range(len(a3)):
                print("output :", round(a3[u][0]))

    model = {"w1": w1, "b1": b1, "w2": w2, "b2": b2}
    f = open("w1.txt", "w")
    f.write(str(w1))
    f.close
    f = open("w2.txt", "w")
    f.write(str(w2))
    f.close
    f = open("b1.txt", "w")
    f.write(str(b1))
    f.close
    f = open("b2.txt", "w")
    f.write(str(b2))
    f.close
    print(len(w1))
    return model

